INSERT INTO `pages` (`id`, `title`, `unit_id`, `created_at`, `updated_at`, `page_type`, `sequence`, `instructions`, `html`, `initial_state`, `solution`, `success_message`, `videotip`, `points`, `question_points`) VALUES
(1, 'Introducción', 1, '2015-11-09 22:56:45', '2015-11-09 22:56:45', 'video', 1, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'El editor de texto y el navegador', 1, '2015-11-10 15:07:59', '2015-11-10 15:07:59', 'video', 2, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'Prueba tu conocimiento: usando el editor de texto', 1, '2015-11-10 15:26:01', '2015-11-15 01:29:35', 'editor', 3, 'INSTRUCCIONES\r\n\r\n 1. En editor de texto, cambia el texto **Esto es un titular** por **Laboratoria**\r\n 2. Luego cambia el texto **Esto es un párrafo** por **En Laboratoria aprendemos a crear páginas web para empezar una carrera en el sector digital**\r\n 3. Al terminar presiona el botón de Guardar y Continuar\r\n\r\nSi has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo.', '', '<html>\r\n  <head></head>\r\n  <body>\r\n    <h1>Esto es un titular</h1>\r\n    <p>Esto es un párrafo</p>\r\n  </body>\r\n</html>', '<html>\r\n  <head></head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p>En Laboratoria aprendemos a crear páginas web para empezar una carrera en el sector digital</p>\r\n  </body>\r\n</html>', '¡Excelente!|Ya empezaste tu camino como desarrolladora web. Presiona el botón de continuar para avanzar.', 'O42uKCBXxlw', 10, NULL),
(4, 'Etiquetas', 1, '2015-11-10 15:30:14', '2015-11-10 15:30:14', 'video', 4, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(5, 'Más etiquetas...', 1, '2015-11-10 15:30:37', '2015-11-10 15:30:37', 'video', 5, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Prueba tu conocimiento: usando etiquetas', 1, '2015-11-10 15:45:21', '2015-11-15 01:29:50', 'editor', 6, 'INSTRUCCIONES\r\n\r\n 1. En editor de texto, dentro del body crea un titular h1 que diga **Laboratoria**\r\n 2. Debajo del h1 crea un párrafo que diga **En Laboratoria aprendemos\r\n    varios lenguajes para crear páginas web. A continuación presentamos\r\n    una lista de los lenguajes que aprendemos.**\r\n 3. Debajo del párrafo crea un titular h4 que diga **Lenguajes:**\r\n 4. Debajo del titular h4 crea una lista con 3 elementos: el primero con el texto **HTML**, el segundo con el texto **Javascript** y el tercero con el texto **PHP**\r\n 5. Al terminar presiona el botón de Guardar y Continuar\r\n\r\n*Nota importante*: debes escribir los textos idénticos a lo solicitado (incluyendo los signos de puntuación) para que el sistema reconozca tu respuesta correctamente. Si has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo. ', '', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body> \r\n  </body>\r\n</html>', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p>En Laboratoria aprendemos varios lenguajes para crear páginas web. A continuación presentamos una lista de los lenguajes que aprendemos.</p>\r\n    <h4>Lenguajes:</h4>\r\n    <ol>\r\n      <li>HTML</li>\r\n      <li>Javascript</li>\r\n      <li>PHP</li>\r\n    </ol>  \r\n  </body>\r\n</html>', '¡Muy bien!|Estás rompiéndola. Presiona el botón de continuar para avanzar.', 'tlCnl6QCx9g', 10, NULL),
(7, 'Imágenes', 1, '2015-11-10 15:46:24', '2015-11-10 15:46:24', 'video', 7, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Prueba tu conocimiento: etiquetas principales', 1, '2015-11-10 15:48:14', '2015-11-15 01:31:19', 'questions', 8, '', '', '', '', '', '', NULL, 3),
(9, 'Tú página necesita estilos', 1, '2015-11-10 15:48:41', '2015-11-10 15:48:41', 'video', 9, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'Prueba tu conocimiento: estilos', 1, '2015-11-10 15:52:31', '2015-11-15 01:30:14', 'editor', 10, 'INSTRUCCIONES\r\n\r\n 1. En el editor de texto, cambia el color del párrafo a azul (tip: azul en inglés se escribe **blue**) y su tamaño de letra a 22px\r\n 2. Al terminar presiona el botón de Guardar y Continuar', '', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p>En Laboratoria aprendemos varios lenguajes para crear páginas web. A continuación presentamos una lista de los lenguajes que aprendemos.</p>\r\n    <h4>Lenguajes:</h4>\r\n    <ol>\r\n      <li>HTML</li>\r\n      <li>Javascript</li>\r\n      <li>PHP</li>\r\n    </ol>  \r\n  </body>\r\n</html>', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p style="color:blue;font-size:22px;">En Laboratoria aprendemos varios lenguajes para crear páginas web. A continuación presentamos una lista de los lenguajes que aprendemos.</p>\r\n    <h4>Lenguajes:</h4>\r\n    <ol>\r\n      <li>HTML</li>\r\n      <li>Javascript</li>\r\n      <li>PHP</li>\r\n    </ol>  \r\n  </body>\r\n</html>', '¡Éxito!|Pareces una profesional. Presiona el botón de continuar para avanzar.', '1pC2S51_GRQ', 10, NULL),
(11, 'Cajas ( divs )', 1, '2015-11-10 15:54:09', '2015-11-10 15:54:09', 'video', 11, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'Reorganizando las Cajas (divs)', 1, '2015-11-10 15:56:38', '2015-11-10 15:56:38', 'video', 12, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(13, 'Prueba tu conocimiento: contenedores', 1, '2015-11-10 15:57:48', '2015-11-15 01:31:47', 'editor', 13, 'INSTRUCCIONES\r\n\r\n 1. En el editor de texto, agrega una caja adicional del mismo ancho y de la misma altura que las demás, pero de color verde (tip: verde en inglés se escribe **green**)\r\n 2. Logra que todos los contenedores estén uno al lado del otro utilizando la propiedad display y el valor inline-block\r\n 3. Al terminar presiona el botón de Guardar y Continuar', '', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <div style="width:50px;height:50px;background-color:red;"></div>\r\n    <div style="width:50px;height:50px;background-color:blue;"></div>\r\n    <div style="width:50px;height:50px;background-color:yellow;"></div>\r\n  </body>\r\n</html>', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <div style="width:50px;height:50px;background-color:red;display:inline-block;"></div>\r\n    <div style="width:50px;height:50px;background-color:blue;display:inline-block;"></div>\r\n    <div style="width:50px;height:50px;background-color:yellow;display:inline-block;"></div>\r\n    <div style="width:50px;height:50px;background-color:green;display:inline-block;"></div>\r\n  </body>\r\n</html>', '¡Fenomenal!|No pares. Eres una coder natural. Presiona el botón de continuar para avanzar.', 'CExTaFKo9So', 10, NULL),
(14, 'Aprende por tu cuenta', 1, '2015-11-10 15:58:16', '2015-11-10 15:58:16', 'video', 14, '', '', NULL, NULL, NULL, NULL, NULL, NULL),
(15, 'Prueba tu conocimiento: autoaprendizaje', 1, '2015-11-10 16:02:11', '2015-11-15 01:32:03', 'questions', 15, '', '', '', '', '', '', NULL, 3),
(16, '', 1, '2015-11-10 16:14:52', '2015-11-10 16:14:52', 'closer', 16, '', '<div class="close-container">\r\n  <h2 class="text-center">\r\n    Felicitaciones has completado el curso\r\n  </h2>\r\n  <h3 class="text-center">Este ha sido tu primer paso para convertirte en desarrolladora web.</h3>\r\n  <h3 class="text-center">¡Sigue adelante!</h3>\r\n</div>', NULL, NULL, NULL, NULL, NULL, NULL);
